import React from 'react';
import Sdata from "./Component/Sdata";
import Card  from "./Component/Card";
import './App.css';

function App() {
  return (
    <div>
      <Card 
      imgsrc="https://wallpapercave.com/wp/wp4056410.jpg" 
      title="A Netflix Original Series" 
      showName="Dark"
      link="www.netflix.com"
      />
      <Card 
      imgsrc="https://www.hitc.com/static/uploads/hitcn/1816/extracurricular_net" 
      title="Netflix Original Series" 
      showName="Extra Curricular"
      link="www.netflix.com"
      />
      <Card 
      imgsrc="https://wallpapercave.com/wp/wp191715.jpg.jpg" 
      title="" 
      showName="Stranger Things"
      link="www.netflix.com"
      />

    </div>
  );
}

export default App;
